// Project Editor Widget - Edit project_name from selected Project record
// Store this in pb.collection('code').create({code: "...", done: false, user: pb.authStore.model.id})
(function() {
  // PocketBase instance should be available globally
  if (typeof pb === 'undefined') {
    console.error('PocketBase instance (pb) not found. Make sure PocketBase is initialized.');
    return;
  }

  // Global variable to store the selected project data
  if (typeof selectedTarget === 'undefined' || !selectedTarget) {
    console.error('selectedTarget not found. Make sure a Project record is selected.');
    return;
  }

  console.log('Loading project editor widget...');

  // Add styles
  if (!document.getElementById('project-widget-styles')) {
    var style = document.createElement('style');
    style.id = 'project-widget-styles';
    style.textContent = `
      .project-widget{max-width:800px;margin:20px auto;padding:20px;border:1px solid #ddd;border-radius:12px;background:white;box-shadow:0 4px 20px rgba(0,0,0,0.1);font-family:Arial,sans-serif}
      .widget-header{background:#059669;color:white;padding:20px;border-radius:8px;margin-bottom:20px;text-align:center}
      .widget-header h2{margin:0;font-size:24px}
      .project-info{background:#f0f9ff;border:1px solid #0284c7;border-radius:8px;padding:15px;margin-bottom:20px}
      .project-info h3{margin:0 0 10px 0;color:#0284c7;font-size:18px}
      .project-info p{margin:5px 0;color:#0369a1}
      .form-section{margin-bottom:20px;padding:15px;border:1px solid #e5e7eb;border-radius:8px;background:#f9fafb}
      .form-group{margin-bottom:15px}
      .form-group label{display:block;margin-bottom:5px;font-weight:600;color:#374151;font-size:14px}
      .form-group input,.form-group textarea{width:100%;padding:12px;border:1px solid #d1d5db;border-radius:6px;font-size:14px;box-sizing:border-box;transition:border-color 0.2s}
      .form-group input:focus,.form-group textarea:focus{outline:none;border-color:#059669;box-shadow:0 0 0 3px rgba(5,150,105,0.1)}
      .btn{padding:12px 24px;border:none;border-radius:6px;cursor:pointer;font-weight:600;transition:all 0.2s;margin:5px}
      .btn-primary{background:#059669;color:white}
      .btn-secondary{background:#6b7280;color:white}
      .btn-danger{background:#ef4444;color:white}
      .btn:hover{opacity:0.9;transform:translateY(-1px)}
      .btn:disabled{opacity:0.5;cursor:not-allowed;transform:none}
      .error-message{background:#fef2f2;color:#dc2626;padding:10px;border-radius:6px;margin:10px 0;font-size:14px}
      .success-message{background:#f0fdf4;color:#15803d;padding:10px;border-radius:6px;margin:10px 0;font-size:14px}
      .data-display{background:#f8f9fa;border:1px solid #dee2e6;border-radius:6px;padding:15px;margin:10px 0}
      .data-display pre{margin:0;font-size:12px;white-space:pre-wrap;max-height:300px;overflow-y:auto}
      .loading{text-align:center;padding:20px;color:#6b7280}
      .field-grid{display:grid;grid-template-columns:repeat(auto-fit,minmax(250px,1fr));gap:15px}
      .readonly-field{background:#f3f4f6;color:#6b7280;cursor:not-allowed}
    `;
    document.head.appendChild(style);
  }

  // Create the widget without React - using vanilla JS
  function createProjectWidget() {
    let projectData = selectedTarget.data ? { ...selectedTarget.data } : {};
    let originalData = { ...projectData };
    let hasChanges = false;
    
    // Create container
    let container = document.getElementById('project-editor-widget-container');
    if (!container) {
      container = document.createElement('div');
      container.id = 'project-editor-widget-container';
      document.body.appendChild(container);
    }
    
    // Helper functions
    function formatFieldName(fieldName) {
      return fieldName
        .replace(/_/g, ' ')
        .replace(/([A-Z])/g, ' $1')
        .replace(/^./, str => str.toUpperCase());
    }
    
    function isEditableField(fieldName) {
      const editableFields = [
        'project_name', 'customer', 'status', 'priority', 'notes',
        'expected_start_date', 'expected_end_date', 'project_type',
        'department', 'estimated_costing'
      ];
      return editableFields.includes(fieldName);
    }
    
    function getFieldType(fieldName, value) {
      if (fieldName.includes('date')) return 'date';
      if (fieldName.includes('time')) return 'time';
      if (typeof value === 'number' || fieldName.includes('cost') || fieldName.includes('amount')) return 'number';
      if (fieldName === 'notes' || fieldName === 'message') return 'textarea';
      return 'text';
    }
    
    function checkForChanges() {
      hasChanges = JSON.stringify(projectData) !== JSON.stringify(originalData);
      updateButtons();
    }
    
    function updateButtons() {
      const saveBtn = document.getElementById('project-save-btn');
      const resetBtn = document.getElementById('project-reset-btn');
      
      if (saveBtn) {
        saveBtn.disabled = !hasChanges;
        saveBtn.textContent = hasChanges ? 'Save Changes' : 'No Changes';
        saveBtn.className = `btn ${hasChanges ? 'btn-primary' : 'btn-secondary'}`;
      }
      
      if (resetBtn) {
        resetBtn.disabled = !hasChanges;
      }
    }
    
    function showMessage(message, isError = false) {
      // Remove existing messages
      const existingMessages = container.querySelectorAll('.error-message, .success-message');
      existingMessages.forEach(msg => msg.remove());
      
      // Create new message
      const messageDiv = document.createElement('div');
      messageDiv.className = isError ? 'error-message' : 'success-message';
      messageDiv.textContent = message;
      
      // Insert after header
      const header = container.querySelector('.widget-header');
      header.insertAdjacentElement('afterend', messageDiv);
      
      // Auto-remove after 5 seconds
      setTimeout(() => {
        if (messageDiv.parentNode) {
          messageDiv.remove();
        }
      }, 5000);
    }
    
    async function handleSave() {
      const saveBtn = document.getElementById('project-save-btn');
      saveBtn.disabled = true;
      saveBtn.textContent = 'Saving...';
      
      try {
        await pb.collection('item').update(selectedTarget.id, {
          data: projectData
        });
        
        selectedTarget.data = { ...projectData };
        originalData = { ...projectData };
        hasChanges = false;
        
        showMessage('Project data saved successfully!');
        updateButtons();
        
      } catch (error) {
        console.error('Save error:', error);
        showMessage(`Error saving project: ${error.message}`, true);
        updateButtons();
      }
    }
    
    function handleReset() {
      projectData = { ...originalData };
      hasChanges = false;
      renderWidget();
    }
    
    function handleFieldChange(fieldName, value) {
      projectData[fieldName] = value;
      checkForChanges();
    }
    
    function toggleFullData() {
      const dataDisplay = document.getElementById('project-full-data');
      const toggleBtn = document.getElementById('project-toggle-data-btn');
      
      if (dataDisplay.style.display === 'none') {
        dataDisplay.style.display = 'block';
        dataDisplay.querySelector('pre').textContent = JSON.stringify(projectData, null, 2);
        toggleBtn.textContent = 'Hide Full Data';
      } else {
        dataDisplay.style.display = 'none';
        toggleBtn.textContent = 'Show Full Data';
      }
    }
    
    function renderWidget() {
      container.innerHTML = `
        <div class="project-widget">
          <div class="widget-header">
            <h2>Project Editor</h2>
            <div style="font-size: 14px; margin-top: 10px;">
              Record ID: ${selectedTarget.id} | Name: ${selectedTarget.name}
            </div>
          </div>
          
          <div class="project-info">
            <h3>Project Overview</h3>
            <p>Current Project Name: ${projectData.project_name || 'Not set'}</p>
            <p>Customer: ${projectData.customer || 'Not set'}</p>
            <p>Status: ${projectData.status || 'Not set'}</p>
            <p>Priority: ${projectData.priority || 'Not set'}</p>
          </div>
          
          <div class="form-section">
            <h3 style="margin-bottom: 15px; color: #374151;">Editable Fields</h3>
            <div class="field-grid" id="project-fields">
              ${Object.keys(projectData)
                .filter(key => isEditableField(key))
                .map(key => {
                  const fieldType = getFieldType(key, projectData[key]);
                  const value = projectData[key] || '';
                  
                  return `
                    <div class="form-group">
                      <label>${formatFieldName(key)}</label>
                      ${fieldType === 'textarea' 
                        ? `<textarea id="field-${key}" rows="3">${value}</textarea>`
                        : `<input type="${fieldType}" id="field-${key}" value="${value}" />`
                      }
                    </div>
                  `;
                }).join('')}
            </div>
          </div>
          
          <div style="display: flex; gap: 10px; justify-content: center; margin-top: 20px; padding-top: 20px; border-top: 2px solid #e5e7eb;">
            <button id="project-save-btn" class="btn btn-secondary" disabled>No Changes</button>
            <button id="project-reset-btn" class="btn btn-secondary" disabled>Reset Changes</button>
            <button id="project-toggle-data-btn" class="btn btn-secondary">Show Full Data</button>
          </div>
          
          <div id="project-full-data" class="data-display" style="display: none;">
            <h4>Complete Project Data:</h4>
            <pre></pre>
          </div>
        </div>
      `;
      
      // Add event listeners
      Object.keys(projectData)
        .filter(key => isEditableField(key))
        .forEach(key => {
          const field = document.getElementById(`field-${key}`);
          if (field) {
            field.addEventListener('input', (e) => {
              const value = getFieldType(key, projectData[key]) === 'number' ? 
                (e.target.value === '' ? '' : Number(e.target.value)) : 
                e.target.value;
              handleFieldChange(key, value);
            });
          }
        });
      
      // Button event listeners
      document.getElementById('project-save-btn').addEventListener('click', handleSave);
      document.getElementById('project-reset-btn').addEventListener('click', handleReset);
      document.getElementById('project-toggle-data-btn').addEventListener('click', toggleFullData);
      
      checkForChanges();
    }
    
    // Initial render
    renderWidget();
  }
  
  // Create the widget
  createProjectWidget();
  
  console.log('Project Editor widget loaded successfully!');
})();

