/*
Looking at your schema JSON example, what's missing in the rendering:

Field Dependencies - depends_on conditions like "eval:doc.status == \"Completed\"" to show/hide fields conditionally
Mandatory Dependencies - mandatory_depends_on for conditional required fields
Fetch From - fetch_from to auto-populate fields from linked records (like "fetch_from": "project.company")
Field Width/Print Width - print_width and width properties for custom field sizing
Table Fields - fieldtype: "Table" with options pointing to child doctypes (like "Task Depends On")
Link Field Options - options for Link fields that specify which doctype to link to (like "options": "Project")
Default Values - default field values that should be applied
Field Ordering/Indexing - idx for proper field sequence
Field States - no_copy, ignore_user_permissions, search_index properties
Advanced Field Types - Missing support for specialized Frappe field types like "Table", "Attach", "Image"
Collapsible Dependencies - collapsible_depends_on for conditional section collapsing
Field Validation - Field-specific validation rules and constraints
The biggest gaps are conditional field display, table/child table fields, and link field autocomplete functionality.*/
// Universal Frappe Form Widget - Renders any doctype using schema
// Store this in pb.collection('code').create({code: "...", done: false, user: pb.authStore.model.id})
(function() {
  // PocketBase instance should be available globally
  if (typeof pb === 'undefined') {
    console.error('PocketBase instance (pb) not found. Make sure PocketBase is initialized.');
    return;
  }

  // Global variable to store the selected record data
  if (typeof selectedTarget === 'undefined' || !selectedTarget) {
    console.error('selectedTarget not found. Make sure a record is selected.');
    return;
  }

  console.log('Loading Universal Frappe Form Widget...');

  // Load Frappe CSS from CDN
  const cssLinks = [
    'https://cdnjs.cloudflare.com/ajax/libs/frappe-ui/0.1.29/frappe-ui.min.css',
    'https://cdnjs.cloudflare.com/ajax/libs/bootstrap/4.6.2/css/bootstrap.min.css'
  ];

  cssLinks.forEach(href => {
    if (!document.querySelector(`link[href="${href}"]`)) {
      const link = document.createElement('link');
      link.rel = 'stylesheet';
      link.href = href;
      document.head.appendChild(link);
    }
  });

  // Universal Form Renderer Class
  class UniversalFrappeForm {
    constructor(container, record) {
      this.container = container;
      this.record = record;
      this.schema = null;
      this.formData = record.data ? { ...record.data } : {};
      this.originalData = { ...this.formData };
      this.hasChanges = false;
      this.sections = {};
      this.fieldElements = {};
      this.currentRow = [];
      
      this.init();
    }

    async init() {
      try {
        await this.loadSchema();
        this.render();
      } catch (error) {
        console.error('Failed to initialize form:', error);
        this.showError(`Failed to load form: ${error.message}`);
      }
    }

    // Load schema for the current doctype
    async loadSchema() {
      const doctype = this.record.doctype;
      
      try {
        // First try to get schema from record meta using name field
        if (this.record.meta && this.record.meta.schema) {
          const schemaRecords = await pb.collection('item').getList(1, 1, {
            filter: `name = "${this.record.meta.schema}"`
          });
          
          if (schemaRecords.items.length > 0) {
            this.schema = schemaRecords.items[0].data;
            return;
          }
        }

        // Fallback: search for schema by doctype
        const schemaRecords = await pb.collection('item').getList(1, 1, {
          filter: `doctype = "Schema" && data.name = "${doctype}"`
        });

        if (schemaRecords.items.length > 0) {
          this.schema = schemaRecords.items[0].data;
          return;
        }

        throw new Error(`No schema found for doctype: ${doctype}`);
      } catch (error) {
        throw new Error(`Error loading schema: ${error.message}`);
      }
    }

    // Field type mappings
    getFieldType(fieldDef) {
      const fieldtype = fieldDef.fieldtype;
      
      switch (fieldtype) {
        case 'Data':
        case 'Link':
          return 'text';
        case 'Int':
          return 'number';
        case 'Float':
        case 'Currency':
        case 'Percent':
          return 'number';
        case 'Date':
          return 'date';
        case 'Datetime':
          return 'datetime-local';
        case 'Time':
          return 'time';
        case 'Check':
          return 'checkbox';
        case 'Select':
          return 'select';
        case 'Text':
        case 'Small Text':
          return 'textarea';
        case 'Text Editor':
          return 'textarea';
        case 'Code':
          return 'textarea';
        case 'Color':
          return 'color';
        case 'Password':
          return 'password';
        default:
          return 'text';
      }
    }

    // Get field options for select fields
    getFieldOptions(fieldDef) {
      if (fieldDef.options && typeof fieldDef.options === 'string') {
        return fieldDef.options.split('\n').filter(option => option.trim());
      }
      return [];
    }

    // Check if field should be hidden
    isFieldHidden(fieldDef) {
      return fieldDef.hidden === 1 || 
             fieldDef.fieldtype === 'Section Break' ||
             fieldDef.fieldtype === 'Column Break';
    }

    // Check if field is read-only
    isFieldReadOnly(fieldDef) {
      return fieldDef.read_only === 1;
    }

    // Check if field is required
    isFieldRequired(fieldDef) {
      return fieldDef.reqd === 1;
    }

    // Check if field should be bold
    isFieldBold(fieldDef) {
      return fieldDef.bold === 1;
    }

    // Format field value based on type
    formatFieldValue(value, fieldDef) {
      if (value === null || value === undefined) return '';
      
      const fieldtype = fieldDef.fieldtype;
      
      switch (fieldtype) {
        case 'Date':
          if (value) {
            const date = new Date(value);
            return date.toISOString().split('T')[0];
          }
          return '';
        case 'Datetime':
          if (value) {
            const date = new Date(value);
            return date.toISOString().slice(0, 16);
          }
          return '';
        case 'Check':
          return value ? true : false;
        case 'Float':
        case 'Currency':
        case 'Percent':
          return parseFloat(value) || 0;
        case 'Int':
          return parseInt(value) || 0;
        default:
          return value;
      }
    }

    // Create field element
    createFieldElement(fieldDef) {
      const fieldType = this.getFieldType(fieldDef);
      const fieldName = fieldDef.fieldname;
      const fieldValue = this.formatFieldValue(this.formData[fieldName], fieldDef);
      
      let element;

      if (fieldType === 'select') {
        element = document.createElement('select');
        element.className = 'form-control';
        
        // Add empty option
        const emptyOption = document.createElement('option');
        emptyOption.value = '';
        emptyOption.textContent = '';
        element.appendChild(emptyOption);
        
        // Add options
        const options = this.getFieldOptions(fieldDef);
        options.forEach(option => {
          const optionElement = document.createElement('option');
          optionElement.value = option;
          optionElement.textContent = option;
          if (fieldValue === option) {
            optionElement.selected = true;
          }
          element.appendChild(optionElement);
        });
      } else if (fieldType === 'textarea') {
        element = document.createElement('textarea');
        element.className = 'form-control';
        element.rows = fieldDef.fieldtype === 'Text Editor' ? 8 : 3;
        element.value = fieldValue;
      } else if (fieldType === 'checkbox') {
        const wrapper = document.createElement('div');
        wrapper.className = 'form-check';
        
        element = document.createElement('input');
        element.type = 'checkbox';
        element.className = 'form-check-input';
        element.checked = fieldValue;
        
        const label = document.createElement('label');
        label.className = 'form-check-label';
        label.textContent = fieldDef.label;
        
        wrapper.appendChild(element);
        wrapper.appendChild(label);
        
        return { element: wrapper, input: element };
      } else {
        element = document.createElement('input');
        element.type = fieldType;
        element.className = 'form-control';
        element.value = fieldValue;
      }

      // Apply field properties
      if (this.isFieldReadOnly(fieldDef)) {
        element.readOnly = true;
      }
      
      if (this.isFieldBold(fieldDef)) {
        element.style.fontWeight = 'bold';
      }

      // Add change listener
      const inputElement = element.querySelector ? element.querySelector('input') || element : element;
      inputElement.addEventListener('change', (e) => {
        this.handleFieldChange(fieldName, e.target.type === 'checkbox' ? e.target.checked : e.target.value, fieldDef);
      });

      return { element, input: inputElement };
    }

    // Handle field value change
    handleFieldChange(fieldName, value, fieldDef) {
      // Convert value based on field type
      let convertedValue = value;
      
      switch (fieldDef.fieldtype) {
        case 'Int':
          convertedValue = value === '' ? null : parseInt(value);
          break;
        case 'Float':
        case 'Currency':
        case 'Percent':
          convertedValue = value === '' ? null : parseFloat(value);
          break;
        case 'Check':
          convertedValue = value ? 1 : 0;
          break;
      }
      
      this.formData[fieldName] = convertedValue;
      this.checkForChanges();
    }

    // Check for changes
    checkForChanges() {
      this.hasChanges = JSON.stringify(this.formData) !== JSON.stringify(this.originalData);
      this.updateActionButtons();
    }

    // Update action buttons
    updateActionButtons() {
      const saveBtn = this.container.querySelector('#save-btn');
      const resetBtn = this.container.querySelector('#reset-btn');
      
      if (saveBtn) {
        saveBtn.disabled = !this.hasChanges;
        saveBtn.textContent = this.hasChanges ? 'Save' : 'Saved';
        saveBtn.className = `btn ${this.hasChanges ? 'btn-primary' : 'btn-secondary'}`;
      }
      
      if (resetBtn) {
        resetBtn.disabled = !this.hasChanges;
      }
    }

    // Show message
    showMessage(message, type = 'success') {
      // Remove existing alerts
      const existingAlerts = this.container.querySelectorAll('.alert');
      existingAlerts.forEach(alert => alert.remove());
      
      const alert = document.createElement('div');
      alert.className = `alert alert-${type === 'error' ? 'danger' : 'success'}`;
      alert.textContent = message;
      
      const formBody = this.container.querySelector('.form-layout');
