          return new Date(value).toISOString().split('T')[0];
        case 'Datetime':
          return new Date(value).toISOString().slice(0, 16);
        case 'Check':
          return value ? true : false;
        case 'Float':
        case 'Currency':
        case 'Percent':
          return parseFloat(value) || 0;
        case 'Int':
