javascript
// db.js - Local database setup
class LocalDB {
  constructor() {
    this.dbName = 'ExtensionDB';
    this.version = 1;
  }

  async init() {
    return new Promise((resolve, reject) => {
      const request = indexedDB.open(this.dbName, this.version);

      request.onerror = () => reject(request.error);
      request.onsuccess = () => resolve(request.result);

      request.onupgradeneeded = (event) => {
        const db = event.target.result;

        // Users collection
        if (!db.objectStoreNames.contains('users')) {
          const userStore = db.createObjectStore('users', { keyPath: 'id' });
          userStore.createIndex('email', 'email', { unique: true });
        }

        // Posts/Data collection (example)
        if (!db.objectStoreNames.contains('posts')) {
          const postStore = db.createObjectStore('posts', { keyPath: 'id' });
          postStore.createIndex('userId', 'userId', { unique: false });
          postStore.createIndex('updated', 'updated', { unique: false });
        }

        // Sync queue - tracks changes to sync
        if (!db.objectStoreNames.contains('syncQueue')) {
          const syncStore = db.createObjectStore('syncQueue', { 
            keyPath: 'id', 
            autoIncrement: true 
          });
          syncStore.createIndex('timestamp', 'timestamp', { unique: false });
          syncStore.createIndex('synced', 'synced', { unique: false });
        }

        // Local auth state
        if (!db.objectStoreNames.contains('authState')) {
          db.createObjectStore('authState', { keyPath: 'key' });
        }
      };
    });
  }

  // Generic CRUD operations
  async create(storeName, data) {
    const db = await this.init();
    const id = this.generateId();
    const record = {
      ...data,
      id,
      created: new Date().toISOString(),
      updated: new Date().toISOString(),
      _synced: false // Track sync status
    };

    const transaction = db.transaction([storeName, 'syncQueue'], 'readwrite');
    const store = transaction.objectStore(storeName);
    const syncStore = transaction.objectStore('syncQueue');

    // Add to main store
    await this.promisifyRequest(store.add(record));

    // Add to sync queue
    await this.promisifyRequest(syncStore.add({
      collection: storeName,
      recordId: id,
      operation: 'create',
      data: record,
      timestamp: Date.now(),
      synced: false
    }));

    return record;
  }

  async read(storeName, id) {
    const db = await this.init();
    const transaction = db.transaction([storeName], 'readonly');
    const store = transaction.objectStore(storeName);
    return this.promisifyRequest(store.get(id));
  }

  async update(storeName, id, updates) {
    const db = await this.init();
    const transaction = db.transaction([storeName, 'syncQueue'], 'readwrite');
    const store = transaction.objectStore(storeName);
    const syncStore = transaction.objectStore('syncQueue');

    const existing = await this.promisifyRequest(store.get(id));
    if (!existing) throw new Error('Record not found');

    const updated = {
      ...existing,
      ...updates,
      updated: new Date().toISOString(),
      _synced: false
    };

    await this.promisifyRequest(store.put(updated));

    // Add to sync queue
    await this.promisifyRequest(syncStore.add({
      collection: storeName,
      recordId: id,
      operation: 'update',
      data: updated,
      timestamp: Date.now(),
      synced: false
    }));

    return updated;
  }

  async delete(storeName, id) {
    const db = await this.init();
    const transaction = db.transaction([storeName, 'syncQueue'], 'readwrite');
    const store = transaction.objectStore(storeName);
    const syncStore = transaction.objectStore('syncQueue');

    await this.promisifyRequest(store.delete(id));

    // Add to sync queue
    await this.promisifyRequest(syncStore.add({
      collection: storeName,
      recordId: id,
      operation: 'delete',
      timestamp: Date.now(),
      synced: false
    }));
  }

  async list(storeName, options = {}) {
    const db = await this.init();
    const transaction = db.transaction([storeName], 'readonly');
    const store = transaction.objectStore(storeName);

    return this.promisifyRequest(store.getAll());
  }

  generateId() {
    return `${Date.now()}_${Math.random().toString(36).substr(2, 9)}`;
  }

  promisifyRequest(request) {
    return new Promise((resolve, reject) => {
      request.onsuccess = () => resolve(request.result);
      request.onerror = () => reject(request.error);
    });
  }
}
