  // Email Verification
  sendVerificationEmail(email)  Promise<void>
  verifyEmail(code)  Promise<boolean>

  // Optional: Account Linking
  linkAccount(credentials)  Promise<LinkResult>
  unlinkAccount()  Promise<void>
}
Adapter Implementations
1. LocalAuthAdapter
Uses IndexedDB for storage
Hashes passwords locally
Creates local sessions
No network calls
Always available offline
2. PocketBaseAuthAdapter
Wraps PocketBase JavaScript SDK
Communicates with PocketBase server
Handles PocketBase-specific auth flows
