2. Local Adapter (Pure Browser)
javascript
// auth/adapters/LocalAuthAdapter.js
import IAuthService from '../IAuthService.js';

class LocalAuthAdapter extends IAuthService {
  constructor() {
    super();
    this.dbName = 'AuthDB';
    this.dbVersion = 1;
  }

  async login(email, password) {
    const user = await this._getUserByEmail(email);

    if (!user) {
      throw new Error('User not found');
    }

    const passwordHash = await this._hashPassword(password);

    if (user.passwordHash !== passwordHash) {
      throw new Error('Invalid password');
    }

    const session = await this._createSession(user);

    return {
      user: this._sanitizeUser(user),
      token: session.token
    };
  }

  async register(email, password, metadata = {}) {
    const existing = await this._getUserByEmail(email);

    if (existing) {
      throw new Error('User already exists');
    }

    const passwordHash = await this._hashPassword(password);
    const user = {
      id: crypto.randomUUID(),
      email,
      passwordHash,
      ...metadata,
      createdAt: Date.now(),
      verified: false
    };

    await this._saveUser(user);
    const session = await this._createSession(user);

    return {
      user: this._sanitizeUser(user),
      token: session.token
    };
  }

  async logout() {
    await chrome.storage.session.remove('authToken');
  }

  async getCurrentUser() {
    const session = await this.getSession();
    if (!session) return null;

    return await this._getUserById(session.userId);
  }

  async getSession() {
    const result = await chrome.storage.session.get('authToken');
    return result.authToken || null;
  }

  async isAuthenticated() {
    const session = await this.getSession();
    return !!session;
  }

  // Private helper methods
  async _hashPassword(password) {
    const encoder = new TextEncoder();
    const data = encoder.encode(password);
    const hashBuffer = await crypto.subtle.digest('SHA-256', data);
    const hashArray = Array.from(new Uint8Array(hashBuffer));
    return hashArray.map(b => b.toString(16).padStart(2, '0')).join('');
  }

  async _createSession(user) {
    const session = {
      token: crypto.randomUUID(),
      userId: user.id,
      createdAt: Date.now()
    };

    await chrome.storage.session.set({ authToken: session });
    return session;
  }

  _sanitizeUser(user) {
    const { passwordHash, ...sanitized } = user;
    return sanitized;
  }

  // IndexedDB operations
  async _getUserByEmail(email) {
    const db = await this._openDB();
    return new Promise((resolve, reject) => {
      const tx = db.transaction(['users'], 'readonly');
      const store = tx.objectStore('users');
      const index = store.index('email');
      const request = index.get(email);

      request.onsuccess = () => resolve(request.result);
      request.onerror = () => reject(request.error);
    });
  }

  async _saveUser(user) {
    const db = await this._openDB();
    return new Promise((resolve, reject) => {
      const tx = db.transaction(['users'], 'readwrite');
      const store = tx.objectStore('users');
      const request = store.put(user);

      request.onsuccess = () => resolve();
      request.onerror = () => reject(request.error);
    });
  }

  async _openDB() {
    return new Promise((resolve, reject) => {
      const request = indexedDB.open(this.dbName, this.dbVersion);

      request.onerror = () => reject(request.error);
      request.onsuccess = () => resolve(request.result);

      request.onupgradeneeded = (event) => {
        const db = event.target.result;

        if (!db.objectStoreNames.contains('users')) {
          const userStore = db.createObjectStore('users', { keyPath: 'id' });
          userStore.createIndex('email', 'email', { unique: true });
        }
      };
    });
  }
}

export default LocalAuthAdapter;
3. PocketBase Adapter
javascript
// auth/adapters/PocketBaseAuthAdapter.js
import IAuthService from '../IAuthService.js';
import PocketBase from 'pocketbase'; // Import from CDN or bundle

class PocketBaseAuthAdapter extends IAuthService {
  constructor(config) {
    super();
    this.pb = new PocketBase(config.url);
  }

  async login(email, password) {
    try {
      const authData = await this.pb.collection('users').authWithPassword(email, password);

      // Store token in session
      await chrome.storage.session.set({
        authToken: {
          token: this.pb.authStore.token,
          userId: authData.record.id
        }
      });

      return {
        user: authData.record,
        token: this.pb.authStore.token
      };
    } catch (error) {
      throw new Error(`PocketBase login failed: ${error.message}`);
    }
  }

  async register(email, password, metadata = {}) {
    try {
      const user = await this.pb.collection('users').create({
        email,
        password,
        passwordConfirm: password,
        ...metadata
      });

      // Send verification email
      await this.pb.collection('users').requestVerification(email);

      return { user };
    } catch (error) {
      throw new Error(`PocketBase registration failed: ${error.message}`);
    }
  }

  async logout() {
    this.pb.authStore.clear();
    await chrome.storage.session.remove('authToken');
  }

  async getCurrentUser() {
    if (!this.pb.authStore.isValid) {
      return null;
    }

    try {
      // Fetch fresh user data
      const user = await this.pb.collection('users').getOne(this.pb.authStore.model.id);
      return user;
    } catch (error) {
      return null;
    }
  }

  async getSession() {
    const result = await chrome.storage.session.get('authToken');
    return result.authToken || null;
  }

  async isAuthenticated() {
    return this.pb.authStore.isValid;
  }

  async updateProfile(updates) {
    const userId = this.pb.authStore.model.id;
    return await this.pb.collection('users').update(userId, updates);
  }

  async sendVerificationEmail() {
    const email = this.pb.authStore.model.email;
    await this.pb.collection('users').requestVerification(email);
  }

  async verifyEmail(code) {
    try {
      await this.pb.collection('users').confirmVerification(code);
      return true;
    } catch (error) {
      return false;
    }
  }
}

export default PocketBaseAuthAdapter;
4. Hybrid Adapter (Combines Local + Remote)
javascript
// auth/adapters/HybridAuthAdapter.js
import IAuthService from '../IAuthService.js';

class HybridAuthAdapter extends IAuthService {
  constructor(localAdapter, remoteAdapter, config = {}) {
    super();
    this.local = localAdapter;
    this.remote = remoteAdapter;
    this.config = {
      primaryProvider: 'local',
      fallbackEnabled: true,
      autoSync: true,
      ...config
    };
  }

  async login(email, password) {
    // Always try local first (fast)
    try {
      const localResult = await this.local.login(email, password);

      // Background sync with remote if online
      if (navigator.onLine && this.config.autoSync) {
        this._syncWithRemote(email, password).catch(err => {
          console.warn('Remote sync failed:', err);
        });
      }

      return { ...localResult, provider: 'local' };
    } catch (localError) {
      // Fallback to remote if local fails and we're online
      if (navigator.onLine && this.config.fallbackEnabled) {
        try {
          const remoteResult = await this.remote.login(email, password);

          // Cache credentials locally for offline use
          await this._cacheToLocal(email, password);

          return { ...remoteResult, provider: 'remote' };
        } catch (remoteError) {
          throw new Error(`Login failed: ${localError.message}`);
        }
      }

      throw localError;
    }
  }

  async register(email, password, metadata = {}) {
    // Register in both
    const localResult = await this.local.register(email, password, metadata);

    if (navigator.onLine) {
      try {
        await this.remote.register(email, password, metadata);
      } catch (error) {
        console.warn('Remote registration failed, queued for sync:', error);
      }
    }

    return localResult;
  }

  async logout() {
    await Promise.all([
      this.local.logout(),
      this.remote.logout()
    ]);
  }

  async getCurrentUser() {
    // Get from local (fast)
    const user = await this.local.getCurrentUser();

    // Background sync from remote
    if (navigator.onLine && this.config.autoSync) {
      this._syncUserFromRemote().catch(err => {
        console.warn('User sync failed:', err);
      });
    }

    return user;
  }

  async getSession() {
    return await this.local.getSession();
  }

  async isAuthenticated() {
    return await this.local.isAuthenticated();
  }

  // Private sync methods
  async _syncWithRemote(email, password) {
    await this.remote.login(email, password);
  }

  async _cacheToLocal(email, password) {
    try {
      await this.local.register(email, password);
    } catch (error) {
      // User might already exist locally
      console.warn('Local cache failed:', error);
    }
  }

  async _syncUserFromRemote() {
    const remoteUser = await this.remote.getCurrentUser();
    if (remoteUser) {
      // Update local cache
      await this.local.updateProfile(remoteUser);
    }
  }
}

export default HybridAuthAdapter;
5. Service Factory
javascript
// auth/AuthServiceFactory.js
import LocalAuthAdapter from './adapters/LocalAuthAdapter.js';
import PocketBaseAuthAdapter from './adapters/PocketBaseAuthAdapter.js';
import HybridAuthAdapter from './adapters/HybridAuthAdapter.js';

class AuthServiceFactory {
  static create(config) {
    switch (config.provider) {
      case 'local':
        return new LocalAuthAdapter();

      case 'pocketbase':
        return new PocketBaseAuthAdapter({
          url: config.pocketbaseUrl
        });

      case 'hybrid':
        const local = new LocalAuthAdapter();
        const remote = new PocketBaseAuthAdapter({
          url: config.pocketbaseUrl
        });
        return new HybridAuthAdapter(local, remote, config.hybridOptions);

      default:
        throw new Error(`Unknown provider: ${config.provider}`);
    }
  }

  static async createFromSettings() {
    const settings = await chrome.storage.local.get('authConfig');
    const config = settings.authConfig || { provider: 'local' };
    return this.create(config);
  }
}

export default AuthServiceFactory;
