// db/adapters/IndexedDBAdapter.js
import IDatabase from '../IDatabase.js';

class IndexedDBAdapter extends IDatabase {
  constructor(dbName = 'AppDB') {
    super();
    this.dbName = dbName;
    this.version = 1;
  }

  async getDoc(collection, id) {
    const db = await this._openDB();
    return new Promise((resolve, reject) => {
      const tx = db.transaction([collection], 'readonly');
      const store = tx.objectStore(collection);
      const request = store.get(id);

      request.onsuccess = () => resolve(request.result || null);
      request.onerror = () => reject(request.error);
    });
  }

  async createDoc(collection, data) {
    const db = await this._openDB();
    const id = data.id || crypto.randomUUID();
    const doc = {
      ...data,
      id,
      createdAt: new Date().toISOString(),
      updatedAt: new Date().toISOString()
    };

    return new Promise((resolve, reject) => {
      const tx = db.transaction([collection], 'readwrite');
      const store = tx.objectStore(collection);
      const request = store.add(doc);

      request.onsuccess = () => resolve(doc);
      request.onerror = () => reject(request.error);
    });
  }

  async updateDoc(collection, id, data) {
    const db = await this._openDB();
    const existing = await this.getDoc(collection, id);

    if (!existing) {
      throw new Error(`Document ${id} not found in ${collection}`);
    }

    const updated = {
      ...existing,
      ...data,
      id, // Preserve ID
      updatedAt: new Date().toISOString()
    };

    return new Promise((resolve, reject) => {
      const tx = db.transaction([collection], 'readwrite');
      const store = tx.objectStore(collection);
      const request = store.put(updated);

      request.onsuccess = () => resolve(updated);
      request.onerror = () => reject(request.error);
    });
  }

  async deleteDoc(collection, id) {
    const db = await this._openDB();
    return new Promise((resolve, reject) => {
      const tx = db.transaction([collection], 'readwrite');
      const store = tx.objectStore(collection);
      const request = store.delete(id);

      request.onsuccess = () => resolve(true);
      request.onerror = () => reject(request.error);
    });
  }

  async listDocs(collection, options = {}) {
    const db = await this._openDB();
    return new Promise((resolve, reject) => {
      const tx = db.transaction([collection], 'readonly');
      const store = tx.objectStore(collection);
      const request = store.getAll();

      request.onsuccess = () => {
        let docs = request.result;

        // Apply filters
        if (options.filters) {
          docs = this._applyFilters(docs, options.filters);
        }

        // Apply sorts
        if (options.sorts) {
          docs = this._applySorts(docs, options.sorts);
        }

        // Apply limit/offset
        if (options.offset) {
          docs = docs.slice(options.offset);
        }
        if (options.limit) {
          docs = docs.slice(0, options.limit);
        }

        resolve(docs);
      };
      request.onerror = () => reject(request.error);
    });
  }

  async query(collection, query) {
    return this.listDocs(collection, query);
  }

  async batchCreate(collection, docs) {
    const results = [];
    for (const doc of docs) {
      results.push(await this.createDoc(collection, doc));
    }
    return results;
  }

  // Helper methods
  _applyFilters(docs, filters) {
    return docs.filter(doc => {
      return filters.every(filter => {
        const value = this._getNestedValue(doc, filter.field);
        return this._compareValues(value, filter.operator, filter.value);
      });
    });
  }

  _applySorts(docs, sorts) {
    return docs.sort((a, b) => {
      for (const sort of sorts) {
        const aVal = this._getNestedValue(a, sort.field);
        const bVal = this._getNestedValue(b, sort.field);

        if (aVal < bVal) return sort.direction === 'asc' ? -1 : 1;
        if (aVal > bVal) return sort.direction === 'asc' ? 1 : -1;
      }
      return 0;
    });
  }

  _compareValues(docValue, operator, filterValue) {
    switch (operator) {
      case '==': return docValue === filterValue;
      case '!=': return docValue !== filterValue;
      case '>': return docValue > filterValue;
      case '>=': return docValue >= filterValue;
      case '<': return docValue < filterValue;
      case '<=': return docValue <= filterValue;
      case 'in': return filterValue.includes(docValue);
      case 'contains': return docValue?.includes(filterValue);
      default: return false;
    }
  }

  _getNestedValue(obj, path) {
    return path.split('.').reduce((current, key) => current?.[key], obj);
  }

  async _openDB() {
    return new Promise((resolve, reject) => {
      const request = indexedDB.open(this.dbName, this.version);

      request.onerror = () => reject(request.error);
      request.onsuccess = () => resolve(request.result);

      request.onupgradeneeded = (event) => {
        const db = event.target.result;

        // Create common collections
        const collections = ['users', 'posts', 'comments', 'settings'];

        collections.forEach(name => {
          if (!db.objectStoreNames.contains(name)) {
            db.createObjectStore(name, { keyPath: 'id' });
          }
        });
      };
    });
  }
}

export default IndexedDBAdapter;
