// db/adapters/PocketBaseAdapter.js
import IDatabase from '../IDatabase.js';
import PocketBase from 'pocketbase';

class PocketBaseAdapter extends IDatabase {
  constructor(config) {
    super();
    this.pb = new PocketBase(config.url);
    this.subscriptions = new Map();
  }

  async getDoc(collection, id) {
    try {
      return await this.pb.collection(collection).getOne(id);
    } catch (error) {
      if (error.status === 404) return null;
      throw error;
    }
  }

  async createDoc(collection, data) {
    return await this.pb.collection(collection).create(data);
  }

  async updateDoc(collection, id, data) {
    return await this.pb.collection(collection).update(id, data);
  }

  async deleteDoc(collection, id) {
    await this.pb.collection(collection).delete(id);
    return true;
  }

  async listDocs(collection, options = {}) {
    const queryParams = this._buildPocketBaseQuery(options);
    const result = await this.pb.collection(collection).getList(
      queryParams.page,
      queryParams.perPage,
      queryParams
    );
    return result.items;
  }

  async query(collection, query) {
    return this.listDocs(collection, query);
  }

  async batchCreate(collection, docs) {
    const results = [];
    for (const doc of docs) {
      results.push(await this.createDoc(collection, doc));
    }
    return results;
  }

  subscribe(collection, callback) {
    const subscriptionId = crypto.randomUUID();

    this.pb.collection(collection).subscribe('*', (e) => {
      callback({
        action: e.action, // 'create', 'update', 'delete'
        record: e.record
      });
    });

    this.subscriptions.set(subscriptionId, collection);
    return subscriptionId;
  }

  async unsubscribe(subscriptionId) {
    const collection = this.subscriptions.get(subscriptionId);
    if (collection) {
      await this.pb.collection(collection).unsubscribe();
      this.subscriptions.delete(subscriptionId);
    }
  }

  // Convert universal query format to PocketBase format
  _buildPocketBaseQuery(options) {
    const params = {
      page: 1,
      perPage: options.limit || 50
    };

    if (options.offset) {
      params.page = Math.floor(options.offset / params.perPage) + 1;
    }

    // Build filter string
    if (options.filters && options.filters.length > 0) {
      const filterStrings = options.filters.map(f => {
        return this._buildPocketBaseFilter(f);
      });
      params.filter = filterStrings.join(' && ');
    }

    // Build sort string
    if (options.sorts && options.sorts.length > 0) {
      const sortStrings = options.sorts.map(s => {
        return s.direction === 'desc' ? `-${s.field}` : s.field;
      });
      params.sort = sortStrings.join(',');
    }

    return params;
  }

  _buildPocketBaseFilter(filter) {
    const { field, operator, value } = filter;

    switch (operator) {
      case '==':
        return `${field}='${value}'`;
      case '!=':
        return `${field}!='${value}'`;
      case '>':
        return `${field}>'${value}'`;
      case '>=':
        return `${field}>='${value}'`;
      case '<':
        return `${field}<'${value}'`;
      case '<=':
        return `${field}<='${value}'`;
      case 'in':
        return `${field} IN (${value.map(v => `'${v}'`).join(',')})`;
      case 'contains':
        return `${field}~'${value}'`;
      default:
        return `${field}='${value}'`;
    }
  }
}

export default PocketBaseAdapter;
