// db/adapters/KnexAdapter.js
import IDatabase from '../IDatabase.js';
import knex from 'knex';

class KnexAdapter extends IDatabase {
  constructor(config) {
    super();
    this.knex = knex(config);
  }

  async getDoc(collection, id) {
    const doc = await this.knex(collection).where({ id }).first();
    return doc || null;
  }

  async createDoc(collection, data) {
    const id = data.id || crypto.randomUUID();
    const doc = {
      ...data,
      id,
      created_at: new Date(),
      updated_at: new Date()
    };

    await this.knex(collection).insert(doc);
    return doc;
  }

  async updateDoc(collection, id, data) {
    const updated = {
      ...data,
      updated_at: new Date()
    };

    await this.knex(collection).where({ id }).update(updated);
    return { id, ...updated };
  }

  async deleteDoc(collection, id) {
    await this.knex(collection).where({ id }).delete();
    return true;
  }

  async listDocs(collection, options = {}) {
    let query = this.knex(collection);

    // Apply filters
    if (options.filters) {
      options.filters.forEach(filter => {
        query = this._applyKnexFilter(query, filter);
      });
    }

    // Apply sorts
    if (options.sorts) {
      options.sorts.forEach(sort => {
        query = query.orderBy(sort.field, sort.direction);
      });
    }

    // Apply limit/offset
    if (options.limit) {
      query = query.limit(options.limit);
    }
    if (options.offset) {
      query = query.offset(options.offset);
    }

    return await query;
  }

  async query(collection, query) {
    return this.listDocs(collection, query);
  }

  async batchCreate(collection, docs) {
    const docsWithMeta = docs.map(doc => ({
      ...doc,
      id: doc.id || crypto.randomUUID(),
      created_at: new Date(),
      updated_at: new Date()
    }));

    await this.knex(collection).insert(docsWithMeta);
    return docsWithMeta;
  }

  _applyKnexFilter(query, filter) {
    const { field, operator, value } = filter;

    switch (operator) {
      case '==':
        return query.where(field, value);
      case '!=':
        return query.whereNot(field, value);
      case '>':
        return query.where(field, '>', value);
      case '>=':
        return query.where(field, '>=', value);
      case '<':
        return query.where(field, '<', value);
      case '<=':
        return query.where(field, '<=', value);
      case 'in':
        return query.whereIn(field, value);
      case 'contains':
        return query.where(field, 'like', `%${value}%`);
      default:
        return query;
    }
  }
}

export default KnexAdapter;
