// db/DatabaseFactory.js
import IndexedDBAdapter from './adapters/IndexedDBAdapter.js';
import PocketBaseAdapter from './adapters/PocketBaseAdapter.js';
import KnexAdapter from './adapters/KnexAdapter.js';

class DatabaseFactory {
  static create(config) {
    switch (config.provider) {
      case 'indexeddb':
        return new IndexedDBAdapter(config.dbName);

      case 'pocketbase':
        return new PocketBaseAdapter({
          url: config.pocketbaseUrl
        });

      case 'knex':
        return new KnexAdapter(config.knexConfig);

      default:
        throw new Error(`Unknown provider: ${config.provider}`);
    }
  }

  static async createFromSettings() {
    const settings = await chrome.storage.local.get('dbConfig');
    const config = settings.dbConfig || { provider: 'indexeddb' };
    return this.create(config);
  }
}

export default DatabaseFactory;
