    try {
      // Convert universal options to PocketBase format
      const pbOptions = this._convertOptionsToPocketBase(options);

      // Use getList for pagination
      const result = await this.pb.collection(collection).getList(
        pbOptions.page,
        pbOptions.perPage,
        {
          filter: pbOptions.filter,
          sort: pbOptions.sort,
          expand: pbOptions.expand
        }
      );

      return result.items;
    } catch (error) {
      throw new Error(`Failed to list documents: ${error.message}`);
    }
