  _convertFilterToPocketBase(filter) {
    const { field, operator, value } = filter;

    switch (operator) {
      case '==':
        return typeof value === 'string' 
          ? `${field}='${value}'`
          : `${field}=${value}`;

      case '!=':
        return typeof value === 'string'
          ? `${field}!='${value}'`
          : `${field}!=${value}`;

      case '>':
        return `${field}>${value}`;

      case '>=':
        return `${field}>=${value}`;

      case '<':
        return `${field}<${value}`;

      case '<=':
        return `${field}<=${value}`;

      case 'in':
        const inValues = value.map(v => 
          typeof v === 'string' ? `'${v}'` : v
        ).join(',');
        return `${field} IN (${inValues})`;

      case 'contains':
        return `${field}~'${value}'`;

      case 'startsWith':
        return `${field}~'^${value}'`;

      case 'endsWith':
        return `${field}~'${value}$'`;

      default:
        // Fallback to equals
        return typeof value === 'string'
          ? `${field}='${value}'`
          : `${field}=${value}`;
    }
