// ============================================================================
// POCKETBASE ADAPTER
// Implements adapter interface for PocketBase
// ============================================================================

class PocketBaseAdapter {
  constructor(url) {
    this.pb = new PocketBase(url);
  }

  // ============================================================================
  // ADAPTER INTERFACE IMPLEMENTATION
  // ============================================================================

  async connect() {
    try {
      // Test connection
      await this.pb.collection('item').getList(1, 1);
      return true;
    } catch (error) {
      throw new Error('Failed to connect to PocketBase');
    }
  }

  autoCancellation(enabled) {
    this.pb.autoCancellation(enabled);
  }

  // ============================================================================
  // AUTH METHODS
  // ============================================================================

  async getAuthState() {
    return {
      isValid: this.pb.authStore.isValid,
      model: this.pb.authStore.model
    };
  }

  async refreshAuth() {
    await this.pb.collection('users').authRefresh();
  }

  async getCurrentUser() {
    return this.pb.authStore.model;
  }

  async clearAuth() {
    this.pb.authStore.clear();
  }

  async login(email, password) {
    const authData = await this.pb.collection('users').authWithPassword(email, password);
    return {
      user: authData.record,
      token: this.pb.authStore.token
    };
  }

  async createAuthUser(userData) {
    return await this.pb.collection("users").create({
      email: userData.email,
      password: userData.password,
      passwordConfirm: userData.password,
      name: userData.name,
      roles: userData.roles
    });
  }

  // ============================================================================
  // SCHEMA METHODS
  // ============================================================================

  async getSchema(doctype) {
    // PocketBase-specific: you'd need to implement schema retrieval
    // This might require a custom endpoint or collection
    try {
      const schema = await this.pb.collection('schemas').getFirstListItem(
        `doctype = "${doctype}"`
      );
      return schema;
    } catch (error) {
      return null;
    }
  }

  // ============================================================================
  // CRUD METHODS
  // ============================================================================

  async createDoc(collection, data) {
    return await this.pb.collection(collection).create(data);
  }

  async getDoc(collection, id) {
    try {
      return await this.pb.collection(collection).getOne(id);
    } catch (error) {
      if (error.status === 404) return null;
      throw error;
    }
  }

  async updateDoc(collection, id, data) {
    return await this.pb.collection(collection).update(id, data);
  }

  async deleteDoc(collection, id) {
    return await this.pb.collection(collection).delete(id);
  }

  async listDocs(collection, options = {}) {
    // Convert universal filter format to PocketBase
    let filterString = '';

    if (options.filters && options.filters.length > 0) {
      const filterParts = options.filters.map(f => {
        return this._convertFilter(f);
      });
      filterString = filterParts.join(' && ');
    }

    const result = await this.pb.collection(collection).getFullList({
      filter: filterString,
      sort: this._convertSort(options.sorts),
      expand: options.expand
    });

    return result;
  }

  // ============================================================================
  // HELPER METHODS
  // ============================================================================

  _convertFilter(filter) {
    const { field, operator, value } = filter;

    switch (operator) {
      case '==':
        return `${field} = "${value}"`;
      case '!=':
        return `${field} != "${value}"`;
      case '>':
        return `${field} > ${value}`;
      case '>=':
        return `${field} >= ${value}`;
      case '<':
        return `${field} < ${value}`;
      case '<=':
        return `${field} <= ${value}`;
      case 'contains':
        return `${field} ~ "${value}"`;
      default:
        return `${field} = "${value}"`;
    }
  }

  _convertSort(sorts) {
    if (!sorts || sorts.length === 0) return '';

    return sorts.map(s => {
      return s.direction === 'desc' ? `-${s.field}` : s.field;
    }).join(',');
  }
}
