class DatabaseFactory {
  static create(config) {
    switch (config.provider) {
      case 'pocketbase':
        return new PocketBaseAdapter(config.url);

      case 'indexeddb':
        return new IndexedDBAdapter(config.dbName || 'AppDB');

      case 'knex':
        return new KnexAdapter(config.knexConfig);

      case 'hybrid':
        const local = new IndexedDBAdapter(config.dbName);
        const remote = new PocketBaseAdapter(config.url);
        return new HybridAdapter(local, remote);

      default:
        throw new Error(`Unknown database provider: ${config.provider}`);
    }
  }

  static async createFromStorage() {
    const result = await chrome.storage.local.get('dbConfig');
    const config = result.dbConfig || {
      provider: 'pocketbase',
      url: 'http://127.0.0.1:8090/'
    };
    return this.create(config);
  }
}
