Service locator pattern
javascript
// This is a DISPATCHER - it selects from registered adapters
class AdapterRegistry {
  constructor() {
    this.adapters = new Map();
  }

  register(name, adapter) {
    this.adapters.set(name, adapter);
  }

  get(name) {
    const adapter = this.adapters.get(name);
    if (!adapter) {
      throw new Error(`Adapter not found: ${name}`);
    }
    return adapter;
  }

  getActive() {
    // Returns whichever adapter is currently active
    return this.adapters.get(this.activeProvider);
  }

  setActive(name) {
    if (!this.adapters.has(name)) {
      throw new Error(`Cannot set active: ${name} not registered`);
    }
    this.activeProvider = name;
  }
}
Why Dispatcher is Better for Your Use Case
1. Separation of Construction from Selection
Factory: "I'll build what you need" (construction + selection)
Dispatcher: "Pick from what's available" (selection only)
