Knex Adapter Example
javascript
async listDocs(collection, options = {}) {
  let query = this.knex(collection);

  if (options.filters) {
    options.filters.forEach(filter => {
      const { field, operator, value } = filter;

      switch (operator) {
        case '==':
          query = query.where(field, '=', value);
          break;
        case '!=':
          query = query.where(field, '!=', value);
          break;
        case '>':
          query = query.where(field, '>', value);
          break;
        case '>=':
          query = query.where(field, '>=', value);
          break;
        case '<':
          query = query.where(field, '<', value);
          break;
        case '<=':
          query = query.where(field, '<=', value);
          break;
        case 'in':
          query = query.whereIn(field, value);
          break;
        case 'contains':
          query = query.where(field, 'like', `%${value}%`);
          break;
      }
    });
  }

  return await query;
}
MongoDB Adapter Example
javascript
async listDocs(collection, options = {}) {
  const filter = {};

  if (options.filters) {
    options.filters.forEach(f => {
      const { field, operator, value } = f;

      switch (operator) {
        case '==':
          filter[field] = value;
          break;
        case '!=':
          filter[field] = { $ne: value };
          break;
        case '>':
          filter[field] = { $gt: value };
          break;
        case '>=':
          filter[field] = { $gte: value };
          break;
        case '<':
          filter[field] = { $lt: value };
          break;
        case '<=':
          filter[field] = { $lte: value };
          break;
        case 'in':
          filter[field] = { $in: value };
          break;
        case 'contains':
          filter[field] = { $regex: value, $options: 'i' };
          break;
      }
    });
  }

  return await this.db.collection(collection).find(filter).toArray();
}
Benefits of This Approach

 Universal: Works with SQL, NoSQL, in-memory, everything  Readable: Clear what each filter does  Composable: Can combine multiple filters  Type-safe: Structure is predictable  Extensible: Easy to add new operators  Testable: Easy to mock and verify

