{ field: 'user.profile.name', operator: '==', value: 'John' }

// Some adapters need special handling:
// - PocketBase: "user.profile.name = 'John'"
// - MongoDB: { 'user.profile.name': 'John' }
// - IndexedDB: doc.user?.profile?.name === 'John'
2. Case Sensitivity
