// Might need a flag:
{ field: 'email', operator: '==', value: 'test@email.com', caseInsensitive: true }

// Different implementations:
// - PocketBase: "LOWER(email) = 'test@email.com'"
// - SQL: "LOWER(email) = 'test@email.com'"
// - MongoDB: { email: { $regex: /^test@email.com$/i } }
3. NULL Handling
javascript
{ field: 'deletedAt', operator: '==', value: null }

// Different NULL checks:
// - SQL: IS NULL
// - MongoDB: { deletedAt: null }
// - IndexedDB: doc.deletedAt === null
