// background.js
// This is where the actual PocketBase connection lives

let pb = null;
let pbAdapter = null;

// Initialize PocketBase in background
async function initializePocketBase() {
  const config = await chrome.storage.local.get('dbConfig');
  const url = config.dbConfig?.url || 'http://127.0.0.1:8090/';

  pb = new PocketBase(url);
  pb.autoCancellation(false);

  // Create the actual PocketBase adapter
  pbAdapter = new PocketBaseAdapter(url);
  pbAdapter.pb = pb;
}

// Listen for messages from popup/content scripts
chrome.runtime.onMessage.addListener((message, sender, sendResponse) => {
  // Handle async with IIFE
  (async () => {
    try {
      switch (message.action) {
        case 'connect':
          await initializePocketBase();
          sendResponse({ success: true, data: true });
          break;

        case 'listDocs':
          const docs = await pbAdapter.listDocs(message.collection, message.options);
          sendResponse({ success: true, data: docs });
          break;

        case 'getAuthState':
          const authState = await pbAdapter.getAuthState();
          sendResponse({ success: true, data: authState });
          break;

        case 'login':
          const authData = await pbAdapter.login(message.email, message.password);
          sendResponse({ success: true, data: authData });
          break;

        case 'createDoc':
          const created = await pbAdapter.createDoc(message.collection, message.data);
          sendResponse({ success: true, data: created });
          break;

        case 'updateDoc':
          const updated = await pbAdapter.updateDoc(
            message.collection,
            message.id,
            message.data
          );
          sendResponse({ success: true, data: updated });
          break;

        case 'deleteDoc':
          await pbAdapter.deleteDoc(message.collection, message.id);
          sendResponse({ success: true, data: true });
          break;

        default:
          sendResponse({ success: false, error: 'Unknown action' });
      }
    } catch (error) {
      console.error('Background error:', error);
      sendResponse({ success: false, error: error.message });
    }
  })();

  // Keep message channel open for async response
  return true;
});

// Initialize on startup
chrome.runtime.onStartup.addListener(() => {
  initializePocketBase();
});

chrome.runtime.onInstalled.addListener(() => {
  initializePocketBase();
});
