Great question! This is about async propagation in JavaScript. Let me explain the layers:

Why Double Async?
Layer 1: ChromeExtensionAdapter.listDocs() is async

Reason: Chrome message passing is inherently asynchronous

chrome.runtime.sendMessage() doesn't return a value immediately
It uses a callback that fires later when background responds
You wrap it in a Promise to make it await-able
The async keyword tells JavaScript: "This function returns a Promise"

Without async:

javascript
// This WON'T work - can't await a non-async function
listDocs(collection, options) {
  return new Promise(...); // Returns Promise, but not marked async
}

With async:

javascript
// This works - tells JavaScript this is awaitable
async listDocs(collection, options) {
  return new Promise(...); // Properly awaitable
}
Layer 2: UniversalDB.getDoc() is also async

Reason: It awaits the adapter's async function

getDoc() calls this.adapter.listDocs() which is async
To use await, the calling function MUST be async
JavaScript rule: Can't use await in non-async functions

Without async (broken):

javascript
// ERROR: Can't use 'await' outside async function
getDoc(name) {
  const records = await this.adapter.listDocs(...); //  Syntax error
  return records[0];
}

With async (works):

javascript
//  Works because function is marked async
async getDoc(name) {
  const records = await this.adapter.listDocs(...); // Can await now
  return records[0];
}
The Async Chain Concept

Think of it like a chain reaction:

chrome.runtime.sendMessage (callback-based, async)
     wrapped in Promise
ChromeExtensionAdapter.listDocs (must be async to return Promise)
     awaited
UniversalDB.getDoc (must be async to use await)
     awaited
Your app code (must use await or .then())

Each layer must be async because the layer below it is async.

Why Not Just Promise.then()?

You could avoid async at the top layer:

javascript
// Without async/await
getDoc(name) {
  return this.adapter.listDocs(this.MAIN_COLLECTION, {
    filters: [{ field: 'name', operator: '==', value: name }]
  }).then(records => {
    return records.length > 0 ? records[0] : null;
  });
}

But this is:

Harder to read (callback hell potential)
Harder to handle errors (need .catch())
Harder to debug
Less modern JavaScript style

async/await is cleaner:

javascript
async getDoc(name) {
  const records = await this.adapter.listDocs(...);
  return records[0] || null;
}
The Key Rule

In JavaScript:

If a function uses await, it MUST be marked async
If a function calls an async function and needs to wait for result, it should use await
If it uses await, it MUST be async
This cascades up the call stack
Alternative: Non-Async Top Layer

You COULD make the top layer synchronous by returning the Promise directly:

javascript
// No async keyword, just return the Promise
getDoc(name) {
  return this.adapter.listDocs(this.MAIN_COLLECTION, {
    filters: [{ field: 'name', operator: '==', value: name }]
  }).then(records => records[0] || null);
}

Then caller uses:

javascript
db.getDoc('Task-123').then(doc => {
  console.log(doc);
});

// OR still with await (works either way)
const doc = await db.getDoc('Task-123');

But why do this? The async version is more readable and error handling is easier.

Error Handling Difference

With async/await:

javascript
async getDoc(name) {
  try {
    const records = await this.adapter.listDocs(...);
    return records[0] || null;
  } catch (error) {
    console.error('Failed to get doc:', error);
    throw error;
  }
}

Without async (Promise chains):

javascript
getDoc(name) {
  return this.adapter.listDocs(...)
    .then(records => records[0] || null)
    .catch(error => {
      console.error('Failed to get doc:', error);
      throw error;
    });
}

The async version looks like synchronous code, which is easier to reason about.

Bottom Line

Why both are async:

Bottom layer (ChromeExtensionAdapter) - async because Chrome APIs are callback-based
Middle layer (UniversalDB) - async because it needs to await the bottom layer
Top layer (your app) - uses await because middle layer is async

It's async all the way up - once you have asynchronicity at the bottom, it propagates through every layer that needs to wait for the result.

This is not redundant - it's the necessary chain of async operations from the network request all the way to your app code.

