MongoDB: findOne({name: 'x'}) 
SQL: SELECT ... WHERE name = 'x' LIMIT 1 

Doesn't have native get-by-field:

IndexedDB: Only get(id) by primary key - for other fields you must scan
LocalStorage: Must iterate all keys
In-memory arrays: Must filter

By using listDocs() with filters:

IndexedDB adapter can scan and filter
PocketBase adapter can use getList() with filter
Both adapters implement ONE method (listDocs) instead of multiple (getById, getByField, getByName, etc.)
Reason 2: Universal Interface Simplicity

If you had separate methods:

