getDocById(id)          // adapter needs getDocById()
getDocByName(name)      // adapter needs getDocByName()
getDocByField(field, value) // adapter needs getDocByField()

Each adapter must implement 3+ methods.

With listDocs() approach:

javascript
// Good: One adapter method handles all
listDocs(collection, {filters: [...]})  // adapter needs ONE method

Every adapter implements ONE flexible method that handles all cases.

Reason 3: Consistency

Your query interface is consistent:

