async getDocById(id) { ... }
async getDocByName(name) { ... }
async findDocs(filters) { ... }

Problems:

Adapter complexity: Each adapter must implement 3+ methods
Some databases can't optimize: IndexedDB always scans all records anyway
Inconsistency: Different methods for similar operations
More code: More methods = more testing, more bugs, more maintenance
The Pattern: Query-Based Access

This is a common pattern in database abstraction layers:

Mongoose (MongoDB):

javascript
Model.find({name: 'Task-123'})  // Returns array (even if 0 or 1 result)

Sequelize (SQL):

javascript
Model.findAll({where: {name: 'Task-123'}})  // Returns array

Prisma:

javascript
prisma.item.findMany({where: {name: 'Task-123'}})  // Returns array

Your approach:

javascript
db.listDocs('item', {filters: [...]})  // Returns array

Then wrapper function extracts first result:

javascript
async getDoc(name) {
  const results = await this.adapter.listDocs(...);
  return results[0] || null;  // Extract single result
}
Performance Consideration

Question: "Isn't it wasteful to get a list when you only want one?"

Answer: No, because:

PocketBase adapter can add LIMIT 1 to the query:
javascript
async listDocs(collection, options) {
  return await this.pb.collection(collection).getList(1, 1, {
    filter: filterStr  // Server only returns 1 result
  });
}
SQL adapter can add LIMIT 1:
javascript
let query = knex(collection).where(filters).limit(1);
IndexedDB has no choice - must scan anyway, so returning array vs single object makes no difference

The adapter can optimize internally while presenting a simple interface externally.

Summary

Why listDocs() for single document retrieval:

 Simpler adapter interface - One method handles all queries  Works for all databases - Even those without native get-by-field  Consistent API - Same filter format everywhere  Optimizable - Adapters can add LIMIT clauses internally  Flexible - Easy to add sorting, pagination, complex filters later  Industry pattern - How most ORMs work

The universal layer (getDoc) provides the convenient single-document interface while the adapter layer (listDocs) provides the flexible query engine. Best of both worlds!

