class InMemoryAdapter {
  constructor() {
    // In-memory storage: collection name -> array of documents
    this.collections = new Map();
  }

  // Helper: Get or create collection
  _getCollection(collectionName) {
    if (!this.collections.has(collectionName)) {
      this.collections.set(collectionName, []);
    }
    return this.collections.get(collectionName);
  }

  // Get single document by name
  async getDoc(collection, name) {
    const docs = this._getCollection(collection);

    // Lodash find - returns first match or undefined
    const found = _.find(docs, { name: name });

    return found || null;
  }

  // List documents with filters, sorting, pagination
  async listDocs(collection, options = {}) {
    let docs = this._getCollection(collection);

    // Clone to avoid mutating original
    docs = _.cloneDeep(docs);

    // Apply filters
    if (options.filters && options.filters.length > 0) {
      docs = _.filter(docs, (doc) => {
        return _.every(options.filters, (filter) => {
          return this._matchesFilter(doc, filter);
        });
      });
    }

    // Apply sorting
    if (options.sorts && options.sorts.length > 0) {
      const fields = _.map(options.sorts, 'field');
      const orders = _.map(options.sorts, (s) => s.direction === 'desc' ? 'desc' : 'asc');

      docs = _.orderBy(docs, fields, orders);
    }

    // Apply offset
    if (options.offset) {
      docs = _.drop(docs, options.offset);
    }

    // Apply limit
    if (options.limit) {
      docs = _.take(docs, options.limit);
    }

    return docs;
  }

  // Helper: Check if document matches a filter
  _matchesFilter(doc, filter) {
    const { field, operator, value } = filter;

    // Lodash get - safely access nested properties
    const docValue = _.get(doc, field);

    switch (operator) {
      case '==':
        return _.isEqual(docValue, value);

      case '!=':
        return !_.isEqual(docValue, value);

      case '>':
        return docValue > value;

      case '>=':
        return docValue >= value;

      case '<':
        return docValue < value;

      case '<=':
        return docValue <= value;

      case 'in':
        return _.includes(value, docValue);

      case 'contains':
        if (_.isString(docValue)) {
          return _.includes(docValue.toLowerCase(), value.toLowerCase());
        }
        if (_.isArray(docValue)) {
          return _.includes(docValue, value);
        }
        return false;

      case 'startsWith':
        return _.isString(docValue) && _.startsWith(docValue.toLowerCase(), value.toLowerCase());

      case 'endsWith':
        return _.isString(docValue) && _.endsWith(docValue.toLowerCase(), value.toLowerCase());

      default:
        return false;
    }
  }

  // Create document
  async createDoc(collection, data) {
    const docs = this._getCollection(collection);

    // Add timestamps
    const doc = {
      ...data,
      createdAt: new Date().toISOString(),
      updatedAt: new Date().toISOString()
    };

    docs.push(doc);

    return _.cloneDeep(doc);
  }

  // Update document
  async updateDoc(collection, id, data) {
    const docs = this._getCollection(collection);

    // Find index
    const index = _.findIndex(docs, { id: id });

    if (index === -1) {
      throw new Error(`Document with id ${id} not found`);
    }

    // Merge updates
    const updated = {
      ...docs[index],
      ...data,
      id: docs[index].id,  // Preserve id
      updatedAt: new Date().toISOString()
    };

    // Replace in array
    docs[index] = updated;

    return _.cloneDeep(updated);
  }

  // Delete document
  async deleteDoc(collection, id) {
    const docs = this._getCollection(collection);

    // Remove using lodash
    const removed = _.remove(docs, { id: id });

    if (removed.length === 0) {
      throw new Error(`Document with id ${id} not found`);
    }

    return true;
  }

  // Bonus: Count documents
  async countDocs(collection, options = {}) {
    const docs = await this.listDocs(collection, {
      ...options,
      limit: undefined,
      offset: undefined
    });

    return _.size(docs);
  }

  // Bonus: Check if document exists
  async docExists(collection, name) {
    const doc = await this.getDoc(collection, name);
    return !_.isNull(doc);
  }

  // Clear collection (useful for testing)
  async clearCollection(collection) {
    this.collections.set(collection, []);
  }

  // Clear all collections
  async clearAll() {
    this.collections.clear();
  }
}
