// List with filters
const openTasks = await adapter.listDocs('item', {
  filters: [
    { field: 'status', operator: '==', value: 'open' }
  ]
});
// Returns: [task-1, task-2]

// List with sorting
const sortedByPriority = await adapter.listDocs('item', {
  sorts: [
    { field: 'priority', direction: 'desc' }
  ]
});
// Returns: [task-2 (8), task-1 (5), task-3 (3)]

// List with complex filters
const highPriorityOpen = await adapter.listDocs('item', {
  filters: [
    { field: 'status', operator: '==', value: 'open' },
    { field: 'priority', operator: '>=', value: 7 }
  ],
  sorts: [
    { field: 'priority', direction: 'desc' }
  ]
});
// Returns: [task-2]

// Pagination
const page1 = await adapter.listDocs('item', {
  limit: 2,
  offset: 0
});

const page2 = await adapter.listDocs('item', {
  limit: 2,
  offset: 2
});

// Search by title
const codeRelated = await adapter.listDocs('item', {
  filters: [
    { field: 'title', operator: 'contains', value: 'code' }
  ]
});
